import React from 'react';
import EquipmentList from '../components/EquipmentList/EquipmentList';

function EquipmentListPage() {
  return (
    <div>
      <h1>Lista de Equipamentos</h1>
      <EquipmentList />
    </div>
  );
}

export default EquipmentListPage;
